import React from "react";
import css from "./ErrorComponent.module.css";

const ErrorComponent = (props) => {
    return(
        <div className={css.error}>
            404 error
            <a href="/">
                Вернуться на главную страницу
            </a>
        </div>
    );
}

export default ErrorComponent;
